// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "../token/Fighter.sol";
import "../authority/Member.sol";
import "../libraries/NftLibrary.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title Fighter Z Token Card Shop
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract CardShop is Member {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    RateStruct[] private _rates;
    EnumerableSet.UintSet private _cards;
    mapping (address => uint256) private _amounts;

    struct RateStruct { uint16 start; uint16 plus; }
    event Buy(uint8 quality, uint16 heroId, uint256 tokenId, uint16 rate);

    constructor(address auth_) Member(auth_) {
        _rates.push(RateStruct({start: 50,   plus: 150}));
        _rates.push(RateStruct({start: 90,   plus: 410}));
        _rates.push(RateStruct({start: 200,  plus: 800}));
        _rates.push(RateStruct({start: 2000, plus: 0}));
    }

    function _random(uint256 value_) private view
        returns (uint256 result) {

        bytes32 h = keccak256(abi.encodePacked(
            block.timestamp, block.number
        ));

        bytes memory seed = abi.encodePacked(h);
        result = uint256(keccak256(seed)) % value_;
        result = result == 0 ? value_ : result;
    }

    function _choose() private returns
        (uint8 quality, uint8 heroId, uint16 rate) {

        uint256 ran = _random(_cards.length() - 1);
        (quality, heroId) = NftLibrary.cRight(_cards.at(ran));

        RateStruct memory rs = _rates[quality];
        rate = uint16(_random(rs.plus + rs.start));

        if (rate >= (rs.start + rs.plus))
            rate = rate - rs.start;

        _cards.remove(_cards.at(ran));
    }

    function setSaleAmount(string memory name_, uint256 amount_)
        public CheckPermit("CONFIG") {

        _amounts[authority.members(name_)] = amount_ * 1e18;
    }

    function setCardsByQuality(
        uint8 quality_, uint8 role_, uint256 supply_
    ) external CheckPermit("CONFIG") {

        uint16 index = uint16(_cards.length() + 1);

        for (uint256 i = 0; i < supply_; i++) {
            for (uint8 j = 0; j < role_; j++) {
                _cards.add(NftLibrary.cLeft(
                    quality_, j + 1, index
                ));

                index = index + 1;
            }
        }
    }

    function setCardsSingle(
        uint8 quality_, uint8 role_, uint256 supply_
    ) external CheckPermit("CONFIG") {
        uint16 index = uint16(_cards.length() + 1);

        for (uint256 i = 0; i < supply_; i++) {
            _cards.add(NftLibrary.cLeft(
                quality_, role_, index
            ));

            index = index + 1;
        }
    }

    function fresh(uint8 quality_, uint16 role_) public
        CheckPermit("EXCHANGE") {

        uint256 index = _cards.length() + 1;
        _cards.add((quality_ * 1e15) + role_ + (index * 1e8));
    }

    function buy(string memory symbol_) public
        CheckStatus("BUY") {

        require(
            !authority.authorities(address(0), "OPEN"),
            "CARDSHOP: Shop is not open."
        );

        address token = authority.members(symbol_);
        address recipient = authority.members("RECIPIENT");

        bool success = IERC20(token).transferFrom(
            msg.sender, recipient, _amounts[token]
        );

        require(success, "CARDSHOP: Transaction failed");

        NftLibrary.DetailStruct memory ds;
        ds.amount = _amounts[token];
        (ds.quality, ds.heroId, ds.rate) = _choose();
        uint104 tokenId = NftLibrary.tLeft(ds);

        address nft = authority.members("FIGHTER");
        Fighter(nft).buy(msg.sender, tokenId);

        emit Buy(ds.quality, ds.heroId, tokenId, ds.rate);
    }
}

